      </p>
      <p>
        Except as contained in this notice, the name of Maciej Waszyński shall not be used in advertising or otherwise to promote the sale, use or other dealings in this Software without prior written authorization from Maciej Waszyński.
      </p>
    </div>
  );
};

export default LicenseComp;
